import React, { useState } from "react";

const StoreCards = ({ title, description, price, image,  }) => {

    return (
        <div className="cardProducts">
            <div><img  className="productImage" src={image}/></div>
            <div className="productInfo">
                <p className="textTitle">{title}</p>
                <p className="textBody">{description}</p>
            </div>
            <div className="productFooter">
                <span className="textTitle">{price}</span>
                <button className="productButton"></button>
            </div>
        </div>
    )
}

export default StoreCards;
